function murmur2_original(str) {
  // 'm' and 'r' are mixing constants generated offline.
  // They're not really 'magic', they just happen to work well.

  // const m = 0x5bd1e995;
  // const r = 24;

  // Initialize the hash

  var h = 0

  // Mix 4 bytes at a time into the hash

  var k,
    i = 0,
    len = str.length
  for (; len >= 4; ++i, len -= 4) {
    k =
      (str.charCodeAt(i) & 0xff) |
      ((str.charCodeAt(++i) & 0xff) << 8) |
      ((str.charCodeAt(++i) & 0xff) << 16) |
      ((str.charCodeAt(++i) & 0xff) << 24)

    k =
      /* Math.imul(k, m): */
      (k & 0xffff) * 0x5bd1e995 + (((k >>> 16) * 0xe995) << 16)
    k ^= /* k >>> r: */ k >>> 24

    h =
      /* Math.imul(k, m): */
      ((k & 0xffff) * 0x5bd1e995 + (((k >>> 16) * 0xe995) << 16)) ^
      /* Math.imul(h, m): */
      ((h & 0xffff) * 0x5bd1e995 + (((h >>> 16) * 0xe995) << 16))
  }

  // Handle the last few bytes of the input array

  switch (len) {
    case 3:
      h ^= (str.charCodeAt(i + 2) & 0xff) << 16
    case 2:
      h ^= (str.charCodeAt(i + 1) & 0xff) << 8
    case 1:
      h ^= str.charCodeAt(i) & 0xff
      h =
        /* Math.imul(h, m): */
        (h & 0xffff) * 0x5bd1e995 + (((h >>> 16) * 0xe995) << 16)
  }

  // Do a few final mixes of the hash to ensure the last few
  // bytes are well-incorporated.

  h ^= h >>> 13
  h =
    /* Math.imul(h, m): */
    (h & 0xffff) * 0x5bd1e995 + (((h >>> 16) * 0xe995) << 16)

  return ((h ^ (h >>> 15)) >>> 0).toString(36)
}

const encoder = new TextEncoder()

// bufferLength must be a multiple of 4 to satisfy Int32Array constraints
let bufferLength = 2 * 1024
let buffer = new ArrayBuffer(bufferLength)
let uint8View = new Uint8Array(buffer)
let int32View = new Int32Array(buffer)

function murmur2_improved(str) {
  if (str.length > bufferLength) {
    // buffer.resize() is only available in recent browsers, so we re-allocate
    // a new and views
    bufferLength = str.length + (4 - str.length % 4)
    buffer = new ArrayBuffer(bufferLength)

    uint8View = new Uint8Array(buffer)
    int32View = new Int32Array(buffer)
  }

  const length = encoder.encodeInto(str, uint8View).written;

  // 'm' and 'r' are mixing constants generated offline.
  // They're not really 'magic', they just happen to work well.

  const m = 0x5bd1e995;
  const r = 24;

  // Initialize the hash
  let h = 0

  // Mix 4 bytes at a time into the hash

  let i = 0
  let len = length
  for (; len >= 4; i++, len -= 4) {
    let k = int32View[i]

    k = Math.imul(k, m)
    k ^= k >>> r
    k = Math.imul(k, m)

    h = Math.imul(h, m)
    h ^= k
  }

  // Handle the last few bytes of the input array

  switch (len) {
    case 3:
      h ^= (uint8View[i * 4 + 2] & 0xff) << 16
    case 2:
      h ^= (uint8View[i * 4 + 1] & 0xff) << 8
    case 1:
      h ^= uint8View[i * 4] & 0xff
      h = Math.imul(h, m)
  }

  // Do a few final mixes of the hash to ensure the last few
  // bytes are well-incorporated.

  h ^= h >>> 13
  h = Math.imul(h, m)
  h = (h ^ (h >>> 15)) >>> 0

  return h.toString(36)
}

function murmur2_cached(str, cache) {
  if (cache) {
    const hash = cache.get(str)
    if (hash) {
      return hash
    }
  }
  const hash = murmur2_improved(str)
  if (cache) {
    cache.set(str, hash)
  }
  return hash
}

